TABLEATTRIBUTE.VALUE:
SELECT 
case when cy_month_num= '1' then '12'
else to_char(to_number(cy_month_num)-1)
end CY_MONTH_NUM,
 TO_CHAR(TO_DATE(( case when to_number(cy_month_num)= 1 then 12 
else to_number(cy_month_num)-1 end), 'MM'), 'Mon') CY_MONTH_NAME ,
case when to_number(cy_month_num)= 1 then  
to_number(cy_year_yyyy) -1 
else to_number(cy_year_yyyy ) 
end FISCAL_YEAR
from day_dimension  where  day_date = trunc(sysdate)
